import React, { Component} from 'react'
import ReactDOM from 'react-dom'
import Quiz from './Quiz'

export class App extends Component {

    render() {
        return (
            <div>
                <div>
                  <Quiz />
                </div>
            </div>
        )
    }
}

ReactDOM.render(<App></App>, document.getElementById("root"))
